              <NavDropdown.Divider />  
              <NavDropdown.Item href="#action/3.4">Another Item</NavDropdown.Item>  
            </NavDropdown>  
          </Nav>  
        </Navbar.Collapse>  
      </Container>  
    </Navbar>  
    );  
  }  

export default Header;
